INSERT INTO `pad_part_activite` (`id`, `active`, `code`, `created_at`, `date`, `description`, `libelle`, `updated_at`, `code_convention`, `commentaire`, `statut`, `nom`) VALUES
(6, b'1', NULL, NULL, '2023-01-03', 'TRANSFORMATION \nNUMERIQUE TR\n', 'UCAD', '2023-08-17 11:50:32', 'CONV-00001', 'La Direction du Digital a entam? depuis le mois de d?cembre 2019 pour une dur?e de six mois dans un premier temps l?engagement de 15 ?tudiants pour travailler dans des projets importants, permettant de couvrir des blocs fonctionnels n?ayant pas une couverture applicative. Plusieurs projets ont ?t? identifi? suite ? leur int?gration dans la Direction du Digital qui se r?sument comme suit\n?	Refonte du Syst?me d\'information Portuaire(ATLANTIS)\n?	Suivi du projet de mise en place d\'un progiciel int?gr? (L\'ERP SAP)\n?	Projet Pointage biom?trique et facial \n?	L\'application courrier et Archivage Electronique\n?	L\'application du portail de l?entreprise\n?	Gestion des demandes de mat?rielles (G-Demande)\n?	Gestion des subventions des restaurants \n', 3, NULL),
(7, b'1', NULL, NULL, '2021-01-24', 'FORMATION ET COOPERATION \n', 'CACSUP', '2022-11-23 13:40:28', 'CONV-00002', '\n Demi-courses offertes au Port en 2021.. formation non commenc?e en attente de la validation du DG  \n\n176 portuaires inscrits pour l?obtention de bourses de formation.\n', 3, NULL),
(8, b'1', NULL, NULL, '2018-11-27', 'Mobilit? ? l?int?rieur du port?;\nR?guler les flux et trafic, limiter la congestion', 'CETUD', '2022-03-01 15:42:29', 'CONV-00003', 'Plan de circulation en zone nord.\n VOIR AVEC LA DSTA\n\nLa congestion au zone nord. \n', 1, NULL),
(9, b'1', NULL, NULL, '2040-02-17', 'Gestion du dispositif de pesage des v?hicules lourds de transport de marchandises au port de Dakar', 'CCIAD', '2022-03-08 09:48:02', 'CONV-00004', 'Un maillage complet de la plateforme portuaire en dispositif de pesage. Une rationalisation des modes de gestions du dispositif de pesage au port de Dakar.\nUne conformit? aux exigences du r?glement 14 de l?UEMOA \n', 1, NULL),
(10, b'1', NULL, NULL, '2022-09-16', 'Reboisement, reforestation et am?lioration du cadre de vie\n', 'ASERGMV', '2022-11-23 13:41:43', 'CONV-00008', 'Activit?s de reboisement au niveau des phares et balises \n', 3, NULL),
(11, b'1', NULL, NULL, '2023-04-07', 'Restructuration du r?seau d?assainissement de la partie intra douani?re du port\n', 'ONAS', '2022-03-15 09:09:11', 'CONV-00005', 'Les emprises pour les ouvrages du projet (Station de relevage et station de pompage) ont ?t? identifi?es et la demande de lib?ration a ?t? transmise au structures concern?es du PAD pour lib?ration avant le d?marrage des travaux pr?vus pour juin 2022\n', 2, NULL),
(12, b'1', NULL, NULL, '2022-04-15', 'Vente de batteries usag?es\n', 'GRAVITA', '2022-03-15 09:07:12', 'CONV-00006', 'Inventaire des batteries usag?es en cours au niveau des services du port (en cours )\n\nCollecte de batterie usag?es au niveau du port pr?vue en d?cembre 2021\n', 2, NULL),
(13, b'1', NULL, NULL, '2043-04-28', '?tablissement des conditions de  l?accord d?am?nagement et d??quipement et d?exploitation d?un parking d?attente moderne Mbao1\n', 'EMASE', '2022-03-15 09:10:45', 'CONV-00009', 'Voir avec la DRP ET LA DCEE ? la prochaine r?union du comite de suivi des conventions. \n', 2, NULL),
(14, b'1', NULL, NULL, '2022-09-23', 'Collecte et ?limination par l prestataire des d?chets liquides, d?hydrocarbures et des pneus usag?s g?n?r?s dans le cadre des activit?s du port \n', 'SOCOCIM', '2022-03-15 09:08:24', 'CONV-00010', 'Mise en relation avec Green Business Africa (GBA) collecteurs d?huiles usag?s 6 100 L collectes pour ? la demande des huiles usag?s au niveau de 4sites :\nArmement\nGarage \nPhares et balises\nLMDG \n\nCollecte d?une partie des pneus usag?s par la SOCOCIM\n', 2, NULL),
(15, b'1', NULL, '2022-03-08 09:26:24', '2023-04-16', 'Assistance technique des services du port pour la mise en place d?un dispositif pour la qualit? de l?air en zone nord\n', 'DEEC', '2022-11-23 13:44:01', 'CONV-00012', 'Termes de r?f?rence disponibles pour l?acquisition de capteurs passifs\n', 1, NULL),
(16, b'1', NULL, NULL, '2022-07-14', 'Gestion des d?chets, lutte contre l?insalubrit? et am?lioration du cadre de vie et habitat social', 'PAD / MINISTERE DE L\'URBANISME', '2022-11-23 13:44:32', 'CONV-00011', 'Op?ration de nettoiement des grandes art?res du port.\nCleaning Day au zone Sud, zone nord et alentour du PAD.\nEnqu?te pr?liminaire r?alis? au vu de la caract?risation des d?chets.  \nPrise en charge par la fondation PAD de l??tude de l?UCG sur les d?chets solides du port de Dakar \n', 3, NULL),
(19, b'1', NULL, '2022-03-08 13:30:21', '2021-04-05', 'Dakar Ville Propre/d?sencombrement et am?nagement', 'PAD / VILLE DE DAKAR ', '2022-11-23 13:46:01', 'CONV-00007', 'Programme Dakar ville propre z?ro d?chet.\nEcolo durable (r?habilitation des ?coles).\nZ?ro enfant dans la rue avec CDP Dakar\nR?habilitation de deux CEM Ahmed Malick SY et le CEM Camb?r?ne.\nOp?ration de nettoiement de la baie de Hann.\nLe d?sencombrement au niveau des alentours du port.\nInt?grer la prise en charge de l?interface ville port de mani?re ?vidente \nMettre en place un sous comite (fondation ?PAD-CQHE) pour ?valuer de signer une autre convention \n', 3, NULL),
(20, b'1', NULL, '2022-03-08 13:36:03', '2022-09-13', 'GUICHET UNIQUE  PORTUAIRE\n', 'PAD / DOUANES ', '2022-03-08 13:36:03', 'CONV-00013', 'S?minaire financ? par l?AGPAOC pour la formation des acteurs ? Saly du 12 au 15 juillet 2021 sanctionn? par une attestation.\nFaire du lobbying pour la gouvernance du projet au plus vite d?autant plus que d?ici 2023 le Guichet sera une obligation selon l?OMI au risque de faire partie du black liste des ports n?ayant pas de guichet unique \n', 1, NULL);
